INSERT INTO `Species` VALUES (1,'Elephant','The Asian or Asiatic elephant (Elephas maximus) is the only living species of the genus Elephas and is distributed in Southeast Asia from India in the west to Borneo in the east. Three subspecies are recognized — Elephas maximus maximus from Sri Lanka, the Indian elephant or E. m. indicus from mainland Asia, and E. m. sumatranus from the island of Sumatra.[1] Asian elephants are the largest living land animals in Asia.[4]','http://en.wikipedia.org/wiki/Asian_elephant','elephant','Elephas maximus'),(2,'Zebra','The plains zebra (Equus quagga, formerly Equus burchelli), also known as the common zebra or Burchell\'s zebra, is the most common and geographically widespread species of zebra.[2] It ranges from the south of Ethiopia through East Africa to as far south as Angola and eastern South Africa. The plains zebra remains common in game reserves, but is threatened by human activities such as hunting for its meat and hide, as well as competition with livestock and encroachment by farming on much of its habitat.','http://en.wikipedia.org/wiki/Plains_zebra','zebra','Equus quagga'),(3,'Rhino','The white rhinoceros or square-lipped rhinoceros (Ceratotherium simum) is one of the five species of rhinoceros that still exist. It has a wide mouth used for grazing and is the most social of all rhino species. The white rhino consists of two subspecies: the southern white rhino, with an estimated 17,460 wild-living animals at the end of 2007 (IUCN 2008), and the much rarer northern white rhino. The northern subspecies has very few remaining, all in captivity.','http://en.wikipedia.org/wiki/White_rhinoceros','rhino','Ceratotherium simum'),(4,'Giraffe','The giraffe (Giraffa camelopardalis) is an African even-toed ungulate mammal, the tallest living terrestrial animal and the largest ruminant. Its binomial name refers to its camel-like face and the patches of color on its fur. Its chief distinguishing characteristics are its extremely long neck and legs, its horn-like ossicones and its distinctive markings. It stands 5–6 m (16–20 ft) tall and has an average weight of 1,600 kg (3,500 lb) for males and 830 kg (1,800 lb) for females. It is classified under the family Giraffidae, along with its closest extant relative, the okapi. There are nine subspecies, which are distinguished by their coat patterns.','http://en.wikipedia.org/wiki/Giraffe','giraffe','iraffa camelopardalis'),(5,'Lion','The lion (Panthera leo) is one of the four big cats in the genus Panthera, and a member of the family Felidae. With some males exceeding 250 kg (550 lb) in weight,[4] it is the second-largest living cat after the tiger. Wild lions currently exist in sub-Saharan Africa and in Asia, with an endangered remnant population in Gir Forest National Park in India, having disappeared from North Africa and Southwest Asia in historic times. Until the late Pleistocene, about 10,000 years ago, the lion was the most widespread large land mammal after humans. They were found in most of Africa, across Eurasia from western Europe to India, and in the Americas from the Yukon to Peru.[5] The lion is a vulnerable species, having seen a major population decline of 30–50% over the past two decades[date missing] in its African range.[2] Lion populations are untenable outside designated reserves and national parks. Although the cause of the decline is not fully understood, habitat loss and conflicts with humans are currently the greatest causes of concern. Within Africa, the West African lion population is particularly endangered.','http://en.wikipedia.org/wiki/Lion','lion','Panthera leo');
